(14, '2019-05-16 07:34:42', '2019-05-24 04:48:26', '2019-05-24 04:48:26', '<p> <span style=\"font-size: 1rem;\">Thời gian khuyến mãi: từ 13/5/2019 đến hết ngày 25/5/2019 hoặc đến khi hết hàng). Áp dụng: toàn bộ khách hàng Đại lý cả nước . Hình thức thanh toán: Tiền mặt hoặc Chuyển khoản . Áp dụng sản phẩm: Ổ cứng Toshiba – Hàng chính hãng – Bảo hành 36 tháng.</span><iframe frameborder=\"0\" src=\"//www.youtube.com/embed/1DWhNUKxq-c\" width=\"640\" height=\"360\" class=\"note-video-clip\"></iframe></p>', 'CƠN SỐT Ổ CỨNG TOSHIBA DUY NHẤT 13 NGÀY', 21, 'active', 1, 'news', 0, 0, NULL),
