(16, '2019-05-21 01:39:53', '2019-06-03 04:16:59', NULL, '<p>Lịch trình các địa điểm diễn ra KB-Road Show 11/5/2019: số 2080 Đại Lộ Hùng Vương, Thành Phố Cam Ranh, Tỉnh Khánh Hoà. 18/5/2019: số 89 Phan Đình Phùng, Thành phố Pleiku, Tỉnh Gia Lai. 24/5/2019 &amp; 25/5/2019: Lâm Đồng 31/5/2019: Bà Rịa – Vũng Tàu KBVISION hân hạnh đón chào tất cả quý khách hàng đến tham gia chương trình để có những kiến thức bổ ích về CCTV!</p>', 'CẬP NHẬT LỊCH TRÌNH KB-ROAD SHOW THÁNG 5/2019', 26, 'active', 1, 'news', 1, 0, NULL),
(17, '2019-05-21 01:51:12', '2019-06-03 06:33:43', NULL, '<p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\">Hiện nay, nhu cầu sử dụng camera quan sát ngày càng nhiều, kéo theo đó các công nghệ về camera cũng phát triển không ngừng. Nhiều người biết đến camera hồng ngoại (IR) với những chiếc đèn Led được điều khiển bằng cảm quang, giúp ghi lại hình ảnh trong điều kiện thiếu sáng. Tuy nhiên, chức năng của camera hồng ngoại bị hạn chế ở việc truy xuất hình ảnh với chất lượng trắng đen khi hoạt động trong môi trường thiếu ánh sáng. Vì vậy,&nbsp; một công nghệ mới đã ra đời đánh tan mọi thắc mắc, cũng như giải quyết nhu cầu&nbsp; người dùng về chức năng ghi hình ảnh màu vào ban đêm của camera, đó chính là công nghệ Starlight.</font></p><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\">Trong bài viết này, chúng tôi sẽ chia sẻ với bạn về camera Starlight là gì, hoạt động như thế nào, sự khác biết giữa Starlight và IR (camera hồng ngoại)?</font></p><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\"><br></font></p><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\"><b>Camera Starlight là gì?</b></font></p><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\">Camera Starlight là camera giám sát với khả năng đặc biệt làm chậm màn trập điện tử của nó để thu được nhiều ánh sáng hơn cho bộ chip CCD của camera, cho phép chúng quay video màu trong điều kiện ánh sáng yếu. Thông thường, các camera IR thường chuyển sang đen trắng vào ban đêm để giảm thiểu nhiễu và biến dạng hình ảnh, nhưng với camera Starlight, hình ảnh vẫn giữ được màu sắc cho chất lượng nhận diện khuôn mặt rõ ràng hơn vào ban đêm so với công nghệ cũ.</font></p><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><br></p><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\"><b>Camera Starlight hoạt động như thế nào?</b></font></p><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\">Làm thế nào để các camera Starlight hoạt động chỉ với ánh sáng của 1 ngôi sao hay thậm chí là KHÔNG ánh sáng?</font></p><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\">Trên thực tế, đây là công nghệ cảm biến ánh sáng tiên tiến nhất và khử nhiễu tinh vi dẫn đến độ nhạy đặc biệt và khả năng quan sát ban đêm rõ ràng hơn.</font></p><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\">Cụ thể hơn, công nghệ starlight sử dụng cảm biến kích thước lớn hơn, khẩu độ rộng hơn (cho phép ánh sáng đi vào ống kính để đến cảm biến)&nbsp; và giảm tốc độ màn trập để thu thập đủ ánh sáng nhằm nhận dạng khuôn người và biển số, ngay cả khi mắt người không thể nhìn thấy gì.</font></p><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><br></p><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\"><b>Sự khác biệt giữa IR (hồng ngoại) và Starlight</b></font></p><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\">IR so với Starlingh: Khả năng quan sát vào ban đêm của Starlight tốt hơn so với các camera quan sát ban đêm IR thông thường về độ rõ và chất lượng hình ảnh, và cung cấp tầm quan sát ban đêm màu ngay cả trong điều kiện ánh sáng yếu khi các camera khác phải bật đèn hồng ngoại. Đồng thời, bạn cũng có thể tự chuyển đổi hình ảnh camera Starlight bạn đêm từ trắng đen (B/W) sang chế độ màu (color).</font></p><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\">Và đó là bởi vì các camera Starlight có thể tận dụng tối đa ánh sáng tự nhiên để tạo ra hình ảnh vượt trội hơn bao giờ hết với các cảm biến tiên tiến. Vì vậy, bạn có thể xem hình ảnh ban đêm rõ ràng hơn so với camera quan sát ban đêm IR.</font></p><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><br></p><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\"><b>Camera Starlight có gì đặc biệt?</b></font></p><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\">Camera Starlight xứng đáng được mệnh danh là “chiến binh thách thức bóng tối” đánh bật các&nbsp; loại camera ban đêm chuyên dụng khác. Vì sao???</font></p><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\">Dưới đây là các chức năng minh chứng về độ “chất” của dòng camera cực phẩm này:</font></p><ul><li style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\"><b>Camera an ninh Starlight có độ rõ nét tốt hơn</b></font></li></ul><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\">Như chúng tôi đã đề cập, camera Starlight mang cảm biến siêu nhạy và ống kính cụ thể để đảm bảo quan sát ban đêm đặc biệt với độ phân giải HD, giống như những chiếc 1080p phổ biến nhất trên thị trường.</font></p><ul><li style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\"><b>Ảnh so sánh ban đêm giữa camera starlight – camera thường</b></font></li></ul><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\">Điều đó có nghĩa là bạn có thể nhìn thấy biển số và mọi người nhìn từ xa rõ ràng vào ban đêm khi các camera khác sẽ không xác định được bất kỳ chi tiết nào.</font></p><ul><li style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\"><b>Camera Starlight có cảm biến tiên tiến cho tầm nhìn xa</b></font></li></ul><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\">So với các camera hồng ngoại dựa vào phản xạ ánh sáng hồng ngoại để tạo ra hình ảnh, các camera Starlight sử dụng ánh sáng tự nhiên đến từ các vật thể khác ngay cả trong điều kiện ánh sáng yếu.</font></p><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\">Và do đó, camera Starlight cho tầm nhìn rõ và xa hơn so với các camera thông thường.</font></p><ul><li style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\"><b>Camera Starlight cho ánh sáng yếu và không có môi trường ánh sáng</b></font></li></ul><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\">Camera Starlight có thể được áp dụng trong một loạt các tình huống và môi trường thiếu sáng. Một số môi trường được hưởng lợi từ các camera starlight an ninh gia tăng có thể đạt được.</font></p><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\">Những nơi có ánh sáng yếu hoặc không có ánh sáng, ví dụ, trong quán bar hoặc câu lạc bộ có thể được hưởng lợi từ công nghệ Starlight. Ánh sáng yếu và trong điều kiện như vậy, các camera bình thường sẽ chuyển sang chụp ảnh đen trắng, nhưng camera công nghệ Starlghit sẽ tiếp tục chụp ảnh màu rõ nét.</font></p><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><br></p><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\"><b>Một số camera Starlight mà bạn có thể lựa chọn</b></font></p><ul><li style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\">KX-S2003C4</font></li><li style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\">KX-S2005C4</font></li><li style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\">KX-S2001C4</font></li></ul>', 'STARLIGHT SERIES – DÒNG CAMERA “ĐẬP TAN BÓNG TỐI” BẰNG CÔNG NGHỆ VƯỢT TRỘI', 27, 'active', 1, 'news', 0, 0, 'https://kbvision.vn/2019/04/26/starlight-series-dong-camera-dap-tan-bong-toi-bang-cong-nghe-vuot-troi/'),
(18, '2019-05-21 01:53:15', '2019-06-03 06:49:41', NULL, '<div>KBVISION – nhà cung cấp nổi tiếng về các sản phẩm và giải pháp giám sát đến từ Mỹ (USA) đã trình làng công nghệ cảm biến thông minh PIR tích hợp trong dòng sản phẩm mới HD-CVI PIR 2.0/4.0 MP (HDCVI-PIR)&nbsp; của mình để cho phép phát hiện chuyển động và báo động với độ chính xác cực chuẩn.</div><div><br></div><div><br></div><div><br></div><div><b>Công nghệ cảm biến PIR là gì?</b></div><div><br></div><div>PIR sensor alarm là viết tắt của Passive Infra-Red sensor là một cảm biến thụ động cấu tạo bởi nguồn kích thích là tia hồng ngoại. Tia hồng ngoại (IR) chính là các tia nhiệt phát ra từ các vật thể nóng. Trên thực tế, trong các cơ thể sống và ngay cả trong con người luôn có thân nhiệt (thông thường là ở 37 độ C), các tia nhiệt được hình thành dựa theo đó và liên tục phát ra trong quá trình chúng ta hoạt động, hay còn gọi là các tia hồng ngoại.</div><div><br></div><div>Nói một cách đơn giản hơn, khi một đối tượng vô tri vô giác chuyển động (cành cây, quạt máy, xe đẩy,…) hoặc những vật thể nhỏ di chuyển (chó, mèo, bò sát,…)&nbsp; thiết bị sử dụng công nghệ PIR sẽ không có báo động, nhưng khi cảm nhận được chuyển động của cơ thể con người, một cảnh báo sẽ được kích hoạt. Khác với những camera sử dụng công nghệ thông thường, khi cài đặt chức năng báo động chuyển động, camera sẽ ghi nhận luôn những trường hợp có cành cây rung hoặc ánh sáng thay đổi. Riêng đối với công nghệ PIR sẽ giúp lọc ra các báo động giả tiết kiệm không gian lưu trữ và cũng có nghĩa là tìm kiếm hiệu quả hơn trong mọi trường hợp, vì có ít cảnh báo để xem xét thông qua.</div><div><br></div><div>Ngoài ra, camera sử dụng cảm biến PIR còn có thêm chức năng truyền tải nguồn, tín hiệu trên cáp đồng trục, không cần đi thêm dây nguồn như các loại camera khác.</div><div><br></div><div><div><b>Ứng dụng công nghệ cảm biến thông minh PIR vào dòng sản phẩm KBVISION</b></div><div><br></div><div>Nhận ra được sự hữu ích từ công nghệ PIR, KBVISION đã nghiên cứu và phát triển công nghệ&nbsp; này vào trong dòng sản phẩm&nbsp; HD-CVI PIR 2.0/4.0 MP qua mã bên dưới:</div><div><br></div><ul><li>KX-2001C.PIR</li><li><span style=\"font-size: 1rem;\">KX-4001C.PIR</span></li></ul><p><span style=\"box-sizing: border-box; font-weight: bolder; color: rgb(119, 119, 119); font-family: helvetica;\">Ứng dụng giải pháp:</span><span style=\"color: rgb(119, 119, 119); font-family: helvetica;\">&nbsp;bảo vệ phạm vi khu vực hàng rào xung quanh nhà và những khu vực như: công ty, văn phòng…hoặc những nơi khác như đầm tôm, nông trại, ….</span></p></div>', 'ỨNG DỤNG CÔNG NGHỆ CẢM BIẾN THÔNG MINH PIR TRONG CAMERA KBVISION', 28, 'active', 1, 'news', 0, 0, 'https://kbvision.vn/2019/05/13/ung-du%CC%A3ng-cong-nghe%CC%A3-ca%CC%89m-bien-thong-minh-pir-trong-camera-kbvision/'),
(19, '2019-05-21 01:54:29', '2019-06-03 06:09:18', NULL, '<p>KBWIN là dòng sản phẩm camera IP wifi hiện đại đang nằm trong top sản phẩm camera xu hướng 2019-2020 trên thị trường hiện nay. Cơn sốt “KBWIN” vẫn chưa có dấu hiệu ngưng lại nhờ vào những tính năng cũng như sự tiện dụng của camera này:</p><p>✔ Có thể tự lắp đặt dễ dàng, không cần thợ chuyên môn</p><p>✔ Hình ảnh video và âm thanh chuẩn mượt</p><p>✔ Quan sát ban đêm rõ nét</p><p>✔ Lưu trữ tiết kiệm băng thông trực tiếp trên thẻ nhớ</p><p>✔ Báo động khi có người lạ đột nhập</p><p><span style=\"color: rgb(119, 119, 119); font-family: helvetica;\">Sau đây là hướng dẫn lắp đặt và kết nối camera IP wifi KBWIN dành cho quý khách hàng tự lắp đặt tại nhà: Xem chi tiết tại link này:&nbsp;</span><a href=\"https://kbvision.vn/2019/04/22/huong-dan-lap-dat-va-ket-noi-camera-wifi-kbwin-don-gian-nhat/\" style=\"font-size: 1rem;\">https://kbvision.vn/2019/04/22/huong-dan-lap-dat-va-ket-noi-camera-wifi-kbwin-don-gian-nhat/</a></p>', 'HƯỚNG DẪN LẮP ĐẶT VÀ KẾT NỐI CAMERA WIFI KBWIN ĐƠN GIẢN NHẤT', 29, 'active', 1, 'news', 0, 0, 'https://kbvision.vn/2019/04/22/huong-dan-lap-dat-va-ket-noi-camera-wifi-kbwin-don-gian-nhat/'),
(20, '2019-05-21 01:55:28', '2019-06-03 06:24:22', NULL, '<p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\">Hiện nay, nhu cầu sử dụng camera ngày càng rộng rãi, từ nhà ở cho đến các khu dân cư, trong các siêu thị, bệnh viện, trường học, hay giao thông,…Mục đích cuối cùng là đáp ứng nhu cầu an ninh, giúp cho việc kiểm soát an ninh hiệu quả hơn. Với mục đích đó thì đòi hỏi hình ảnh phải thật rõ nét và tốc độ đường truyền cao. Mà để có được điều đó thì chúng ta cần phải có một hệ thống Camera hoạt động với hiệu suất cao nhất. Trong một hệ thống như vậy, bên cạnh các camera thì thiết bị đầu ghi cũng được xem là một trong những thành phần quan trọng không thể thiếu.</font></p><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\">Song song với việc sử dụng camera ngày càng phổ biến là sự xuất hiện các mẫu đầu ghi đa dạng về tính năng cũng như chất lượng, nổi bật là sản phẩm đầu ghi NVR POE, một thiết bị mới nhất trong hệ thống camera giám sát hiện nay. Vậy tại sao bạn phải lựa chọn dòng sản phẩm này?</font></p><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\"><b>Trên thị trường hiện nay có 2 loại đầu ghi, đó là đầu ghi Analog và đầu ghi IP:</b></font></p><ul><li style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\"><b>Đầu ghi Analog</b> là đầu ghi được thiết lập và xây dựng trên 1 hệ thống Analog, tức đầu ghi chỉ có thể ghi hình được các loại camera quan sát xuất ra tín hiệu analog thông thường. Tuy nhiên, nhược điểm của loại đầu ghi này là độ an toàn về dữ liệu không được cao, các hình ảnh video không được bảo mật, dễ bị đánh cắp</font></li><li style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\"><b>Đầu ghi IP</b> là đầu ghi được xây dựng hoàn toàn trên nền tảng IP, dòng này chỉ có thể kết nối và làm việc với các loại camera IP. Đầu ghi hình IP thường được tích hợp rất nhiều tính năng phức tạp hơn đầu ghi hình Analog (IVS, chỉ ghi hình khi có chuyển động nhằm giảm thiểu dung lượng ổ cứng). Công nghệ camera IP đòi hỏi sự tương thích cao cho nên việc sử dụng chéo các hãng sản xuất với nhau có khả năng không thể kết hợp được và người dùng có một chút kiến thức về mạng. Tuy nhiên, nó có ưu điểm rất nổi bật là mang lại sự an toàn thông tin cao hơn, cần phải có password mới được truy cập vào, điều đó giúp những hình được bảo mật cao hơn.</font></li></ul><p style=\"box-sizing: border-box; margin-bottom: 1.3em;\"><font color=\"#777777\" face=\"helvetica\"><b>Tại sao bạn phải chọn đầu ghi IP POE?</b></font></p><div><div>Đầu ghi IP POE là một dòng sản phẩm tiên tiến nhất hiện nay với công nghệ POE. Nó là công nghệ cho phép truyền tải nguồn điện trực tiếp trên sợi cáp mạng (Cable RJ45) đến các thiết bị điện tử có cổng Ethernet. Với công nghệ POE tích hợp trong đầu ghi sẽ giúp việc thu thập dữ liệu hình ảnh âm thanh từ camera chất lượng cao nhất, đơn giãn trong thi công, tính thẩm mỹ cao và đồng thời giúp giảm thiểu tối đa cáp nguồn cho hệ thống camera với chỉ cần một sợi dây cáp mạng.</div><div><br></div><div>Với đầu ghi POE sẽ giúp bạn có được những hình ảnh rõ nét chất và đường truyền cao, chỉ cần cắm camera Ip vào là chạy như Analog, không cần cấu hình mạng.</div><div><br></div><div>Tuy đầu ghi IP POE có giá thánh đắt hơn so với các đầu ghi thông thường nhưng bù lại việc thi công dễ dàng hơn, giảm thiểu chi phí nhân công cũng như chi phí vật tư.</div><div><br></div><div>Hiện tại, trên thị trường có nhiều loại đầu ghi được tích hợp công nghệ POE và sản phẩm mà chúng tôi muốn giới thiệu đến các bạn đó chính là đầu ghi IP POE KBVISION. Là một trong những thương hiệu camera thông minh hàng đầu tại Mỹ và các giải pháp an ninh công nghệ cao. Và model đầu ghi IP POE mà chúng tôi muốn giới thiệu với các bạn trong bài viết này là KX-4K8108PN2. Dưới đây là những tính năng cơ bản của đầu ghi IP POE model KX-4K8108PN2:</div><div><br></div><div>● Đầu ghi hình NVR 8 kênh POE ( có sẵn cổng mạng cắm camera ip là chạy không cần cấu hình cam IP)</div><div>● Cổng vào: 8 kênh IP với đầu ghi 8 kênh độ phân giải lên đến 8 Mp, băng thông tối đa 80Mbps</div><div>● Chuẩn nén hình ảnh: H265/MJPEG</div><div>● Cổng ra: VGA / HDMI</div><div>● Xem lại: 8 kênh đồng thời</div><div>● Hỗ trợ chuẩn Onvif 2.4</div><div>● Hỗ trợ: 1 SATA x 6TB, 2USB 2.0</div><div>● Hỗ trợ Cloud , QR Code: dễ dàng cài đặt ,quan sát qua phần mềm trên điện thoại</div><div>● Hỗ trợ: RJ45</div><div>● Hỗ trợ 8 port PoE cho đầu 8 kênh max 25.5w cho mỗi port</div><div>● Hỗ trợ tên miền miễn phí KBVISION.TV trọn đời sản phẩm</div><div>● Hỗ trợ Cloud (server tại Việt Nam hoạt động mạnh mẽ , ổn định) chỉ cần scan QR Code: dễ dàng cài đặt, quan sát qua phần mềm trên điện thoại</div><div>● Hỗ trợ Push video báo động qua thiết bị di động trên phần mềm KBView Pro</div><div>● Hỗ trợ 128 user truy cập cùng lúc thích hợp cho những dự án như trường học , trường mầm non …..</div><div>● Hỗ trợ kết nối với camera của các hãng khác như: Arecont Vision, AXIS, Bosch, Brickcom, Canon, CP Plus, Dynacolor, Honeywell, Panasonic, Pelco, Samsung, Sanyo, Sony, Videosec, Vivotek,…</div><div><br></div><div><b>Vì sao nên chọn đầu ghi IP POE model KX-4K8108PN2?</b></div><div><br></div><div>Đầu ghi IP POE sở hữu chuẩn nén hình ảnh H.265. Đây là một chuẩn nén hình ảnh video hoàn toàn mới có khả năng nén gấp đôi so với chuẩn nén trước đó mà chất lượng không đổi.</div><div><br></div><div>Hỗ trợ Push video báo động qua thiết bị di động: Chức năng phát hiện chuyển động và thông báo, khi có phát hiện chuyển động bất thường thì đầu ghi camera giám sát sẽ tự động gửi thông báo bằng Video tới điện thoại di động của bạn thông qua ứng dụng KBView Pro.</div><div><br></div><div>Việc hỗ trợ Cloud cũng là một ưu điểm đáng chú ý, với sự hỗ trợ này thì bạn chỉ cần cắm dây mạng vào sử dùng mà không cần cấu hình, dễ dàng cài đặt.</div><div><br></div><div>Hỗ trợ ổ cứng SATA 6TB: Trong trường hợp đầu ghi không có ổ cứng thì nó vẫn hoạt động bình thường. Nhưng nó sẽ mất đi khả năng lưu trữ thông tin quan trọng được ghi lại từ các camera. Vì vậy việc lựa chọn đầu ghi có ổ cứng càng lớn thì khả năng lưu trữ dữ liệu càng nhiều. Với đầu ghi IP POE được tích hợp ổ cứng công nghệ SATA, thì tốc độ truyền tải cao hơn, có thể lên đến 150MB/s hoặc 300MB/s so với tốc độ tối đa 133MB/s trong công nghệ trước đây.</div><div><br></div><div>Với những tính năng nổi bật như vậy thì theo bạn có nên mua dòng sản phẩm này không? Để có được hình ảnh chất lượng cao, tín hiệu truyền tải tốt nhằm phục vụ cho hệ thống camera an ninh thì đầu ghi IP POE chính là sự lựa chọn tốt nhất trong hệ thống của bạn.</div></div>', 'Đầu Ghi IP POE-Công Nghệ Mới Cho Lựa Chọn Hoàn Hảo', 30, 'active', 1, 'news', 0, 0, 'https://kbvision.vn/2019/03/28/dau-ghi-ip-poe/'),
