(36, '2019-05-25 12:15:39', '2019-05-31 01:12:48', NULL, '<p>Chúng tôi sẽ thu gom lại toàn bộ sản phẩm đã hư, cũ, đã qua sử dụng muốn đổi qua sản phẩm mới chất lượng hơn, công nghệ mới hơn.</p><p><b>***Đặc biệt không phân biệt Hãng sản xuất.</b></p><p>- Áp dụng: từ ngày <b style=\"background-color: rgb(255, 255, 0);\">25/5/2019</b> đến hết ngày <span style=\"background-color: rgb(255, 255, 0);\"><b>3/7/3019</b></span></p><p>- Áp dụng: Toàn bộ khách hàng Đại lý cả nước</p><p><b>- Sản phẩm áp dụng:</b> KX-2012C4, KX-S2001C4, KX-7104TH1, KX-7108TH1</p><p>Cơ hội để Quý khách hàng đổi những sản phẩm cũ để nhận lấy sản phẩm chất lượng từ KBVISION.</p><p>Mọi thông tin chi tiết về chương trình khuyến mãi Quý khách vui lòng liên hệ đến:</p><p>CÔNG TY TNHH TM KBVISION VIỆT NAM</p><p>-Địa chỉ: 278 Luỹ Bán Bích, phường Hoà Thạnh, quận Tân Phú, TP. Hồ Chí Minh</p><p>-Thời gian làm việc: từ thứ 2 - thứ 7 :8h30 -17h30</p><p>-Hotline Bán Hàng: (028) 3973 2222</p><p>-Hotline Kỹ Thuật : (028) 3973 3533 - 0932685888</p><p>Website: <a href=\"https://kbvision.vn/\" target=\"_blank\">www.kbvision.vn</a></p><p>Rất hân hạnh được phục vụ Quý khách!</p>', 'CHƯƠNG TRÌNH ĐỔI CŨ LẤY MỚI', 54, 'active', 1, 'news', 1, 0, NULL),
(37, '2019-05-25 12:25:17', '2019-05-31 01:12:46', NULL, '<p>- Thời gian khuyến mãi từ <span style=\"background-color: rgb(255, 255, 0);\">25/5/2019</span> đến hết ngày <span style=\"background-color: rgb(255, 255, 0);\">5/6/2019</span></p><p>- Áp dụng: toàn bộ khách hàng Đại lý cả nước</p><p>- Hình thức thanh toán: Tiền mặt hoặc Chuyển khoản</p><p><b>Áp dụng cụ thể những model sau:</b></p><p><span style=\"color: rgb(28, 30, 33); font-family: Helvetica, Arial, sans-serif;\">KX-2121S4, KX-Y2021S4, KX-Y2002C4, KX-2004CA, KX-2004C4, KX-2003C4, KX-S2001C4, KX-7104SD6, KX-7108SD6</span></p><p>KBVISION luôn cập nhật những sản phẩm tốt nhất - công nghệ mới nhất - chương trình khuyến mãi đặc sắc nhất</p><p>Mọi thông tin chi tiết về chương trình khuyến mãi Quý khách vui lòng liên hệ đến:</p><p>CÔNG TY TNHH TM KBVISION VIỆT NAM</p><p>-Địa chỉ: 278 Luỹ Bán Bích, phường Hoà Thạnh, quận Tân Phú, TP. Hồ Chí Minh</p><p>-Thời gian làm việc: từ thứ 2 - thứ 7 :8h30 -17h30</p><p>-Hotline Bán Hàng: (028) 3973 2222</p><p>-Hotline Kỹ Thuật : (028) 3973 3533 - 0932685888</p><p>Website: <a href=\"https://kbvision.vn/\" target=\"_blank\">www.kbvision.vn</a></p><p>Rất hân hạnh được phục vụ Quý khách!</p><p><br></p>', 'BÙNG NỔ KBVISION: MUA CÀNG NHIỀU LỢI CÀNG NHIỀU', 55, 'active', 1, 'news', 1, 0, NULL),
(38, '2019-05-28 08:06:15', '2019-05-29 02:43:33', '2019-05-29 02:43:33', '<p style=\"box-sizing: border-box; margin-bottom: 1.3em; color: rgb(119, 119, 119); font-family: helvetica;\">Để đáp ứng nhu cầu của Quý khách hàng cần hệ thống Camera quan sát đơn giản, dễ sử dụng, không cần qua nhiều bước cấu hình phức tạp.</p><p style=\"box-sizing: border-box; margin-bottom: 1.3em; color: rgb(119, 119, 119); font-family: helvetica;\"><span style=\"box-sizing: border-box; font-weight: bolder;\">KBVISION hân hạnh cho ra mắt bộ KIT với nhiều ưu điểm vô cùng nổi bật:</span></p><ul style=\"box-sizing: border-box; list-style-position: initial; list-style-image: initial; padding: 0px; margin-bottom: 1.3em; color: rgb(119, 119, 119); font-family: helvetica;\"><li style=\"box-sizing: border-box; margin-bottom: 0.6em; margin-left: 1.3em;\">Thiết lập đơn giản</li><li style=\"box-sizing: border-box; margin-bottom: 0.6em; margin-left: 1.3em;\">Chất lượng hình ảnh lên đến 4K</li><li style=\"box-sizing: border-box; margin-bottom: 0.6em; margin-left: 1.3em;\">Hỗ trợ kết nối camera của nhiều hãng khác</li><li style=\"box-sizing: border-box; margin-bottom: 0.6em; margin-left: 1.3em;\">Hỗ trợ lưu trữ Cloud</li><li style=\"box-sizing: border-box; margin-bottom: 0.6em; margin-left: 1.3em;\">Đặc biệt giá thành rẻ – hiệu quả vượt trội</li><li style=\"box-sizing: border-box; margin-bottom: 0.6em; margin-left: 1.3em;\">Thiết kế sang trọng</li><li style=\"box-sizing: border-box; margin-bottom: 0.6em; margin-left: 1.3em;\">Hỗ trợ PoE giúp giảm chi phí dây nguồn và nguồn cho camera</li><li style=\"box-sizing: border-box; margin-bottom: 0.6em; margin-left: 1.3em;\">Hỗ trợ tên miền miễn phí KBVISION.TV trọn đời sản phẩm</li></ul><p style=\"box-sizing: border-box; margin-bottom: 1.3em; color: rgb(119, 119, 119); font-family: helvetica;\"><span style=\"box-sizing: border-box; font-weight: bolder;\">Mã sản phẩm:</span><br style=\"box-sizing: border-box;\">– Camera: KX-K2001N2<br style=\"box-sizing: border-box;\">– Đầu ghi: KX-K8104PN2 và KX-K8108PN2</p><p style=\"box-sizing: border-box; margin-bottom: 1.3em; color: rgb(119, 119, 119); font-family: helvetica;\"><span style=\"box-sizing: border-box; font-weight: bolder;\">Giá bán lẻ sản phẩm bộ KIT:</span><br style=\"box-sizing: border-box;\">– KIT 2: gồm 1 đầu ghi và 2 camera: <span style=\"box-sizing: border-box; font-weight: bolder;\">7.880.000</span> VNĐ<br style=\"box-sizing: border-box;\">– KIT 4: gồm 1 đầu ghi và 4 camera: <span style=\"box-sizing: border-box; font-weight: bolder;\">10.700.000</span> VNĐ<br style=\"box-sizing: border-box;\">– KIT 8: gồm 1 đầu ghi và 8 camera: <span style=\"box-sizing: border-box; font-weight: bolder;\">18.520.000</span> VNĐ</p><p style=\"box-sizing: border-box; margin-bottom: 1.3em; color: rgb(119, 119, 119); font-family: helvetica;\">Sản phẩm thương hiệu Mỹ – chất lượng – nhiều ưu điểm vượt trội – giá rẻ – rất đáng để đầu tư lắp đặt cho gia đình, cửa hàng, công trình nhỏ</p><p style=\"box-sizing: border-box; margin-bottom: 1.3em; color: rgb(119, 119, 119); font-family: helvetica;\">Mọi thông tin chi tiết về sản phẩm Quý khách vui lòng liên hệ đến:</p><p style=\"box-sizing: border-box; margin-bottom: 1.3em; color: rgb(119, 119, 119); font-family: helvetica;\">CÔNG TY TNHH TM KBVISION VIỆT NAM<br style=\"box-sizing: border-box;\">– Địa chỉ: 278 Lũy Bán Bích, phường Hoà Thạnh, quận Tân Phú, TP. Hồ Chí Minh<br style=\"box-sizing: border-box;\">– Thời gian làm việc: từ thứ 2 – thứ 7 :8h30 -17h30<br style=\"box-sizing: border-box;\">– Hotline Bán Hàng: (028) 3973 2222<br style=\"box-sizing: border-box;\">– Hotline Kỹ Thuật : (028) 3973 3533 – 0932685888<br style=\"box-sizing: border-box;\">Website: <a href=\"https://kbvision.vn/\" style=\"box-sizing: border-box; color: rgb(51, 72, 98);\">www.kbvision.vn</a></p><p style=\"box-sizing: border-box; margin-bottom: 1.3em; color: rgb(119, 119, 119); font-family: helvetica;\">Rất hân hạnh được phục vụ Quý khách!</p>', 'RA MẮT BỘ KIT CAMERA 